INSERT INTO `families` VALUES (1,'Absinth Alsem',NULL,NULL,NULL,NULL,NULL,NULL,0,'','2024-09-27 11:17:03','2025-05-08 08:11:29',1,0,NULL),(2,'ATV lotion','Samenstelling: neemolie, tea tree olie, colloïdaal zilver, e.o. lavendula officinalis, cuminum cyninum, limoengras, appelazijn, rimulgan, vitamine E',NULL,NULL,'Niet geschikt voor katten !\nHonden 1 - 2 eetlepels\nPaarden 2 - 3 eetlepels\nKippen 1 eetlepel',NULL,'Schudden voor gebruik.\nIn handpalm verdelen en inmasseren in de vacht\n2 à 3 keer per week, indien nodig dagelijks.\n\nNa opening te gebruiken binnen 6 maanden.',0,'','2024-09-27 11:31:41','2025-02-19 14:52:13',0,0,NULL),(3,'Bio-Chi','Samenstelling: hennepschilfers, mariadistel-schilfers, bernagiezaadschilfers, karwijzaad-schilfers, vruchtenpulp-gedroogd, bierbostel, calciumcarbonaat, monocalciumfosfaat, natriumchloride, calciummagnesiumcarbonaat, calciumnatriumfosfaat, magnesiumoxide, kruiden\n\n94,44% biologische landbouw, 5,56% niet-agrarische herkomst','Aanvullende diervoeder voor paarden,vogels, knaagdieren en konijnen-Analytische bestandsdelen: ruw vet 9,58% - ruw as 8,38% - ruw eiwit 25,47% - ruwe celstof 8,91% - natrium 0,96%- fosfor 0,76%- magnesium 1,11%- calcium 0,44%','Toevoegingsmiddelen: Nutritionele toevoegingsmiddelen:Vitamine A (3a672a) 10.425 I.E. , Vitamine E(3a700) 122 mg/kg ,  Vitamine D3(3a671) 2.063 I.E.,  koper(II) sulfaat pentahydraat (3b405) koper 15 mg/kg, gecoate korrels watervrij calciumjodaat (3b203) jodium 2,4 mg/kg, Mangaan(II) oxide (3b502) mangaan 94 mg/kg, zinkoxide (3b603) zink 94 mg/kg, gecoate korrels natriumseleniet granulaat (3b802) selenium 0,4 mg','Klein paard: 30–50 g\nGroot paard: 50–100 g\nKleine grazers: 20–30 g\nKleinvee en vogels: 2–5 g per dier (afhankelijk van soort)  ','De aanwezigheid van silymarine in mariadistel helpt de levercellen te beschermen en ondersteunt het de lever in zijn ontgiftende functie in het lichaam. *\n* Gezondheidsclaims in afwachting van goedkeuring door de Europese Commissie','Bio-Chi geef je altijd in kuur vorm van enkele weken of maanden. Daarna enkele weken tot maanden niet voeren.\nBij gezonde dieren: 3 dagen per week voeren, afgewisseld met rustdagen\nBij extra behoefte: 4 dagen per week\nIntensieve ondersteuning: dagelijks, gedurende enkele weken of maanden',10,'DE-NW-006-14765-BE','2024-06-01 15:03:58','2025-07-02 10:26:21',1,1,'EU landbouw'),(4,'Actimin gesteente meel','Hoofdelementen in %: silicium (SiO2) 40-50, ijzer (Fe2O3) 9,7-10,8, calcium (CaO) 7,5-8,4, magnesium (MgO) 5,4-7,8, natrium (Na2O) 3-3,4, kalium (K2O) 1,44-1,9, fosfaat(P2O5) 0,44-0,69, zwavel (SO3) 0,02','','Sporenelementen in mg/kg: kobalt(Co) 38, koper (Cu) 41, mangaan(Mn) 1300, molybdeen(Mo) 2, selenium(Se) 0,03 , zink(Zn) 97','grasland: 1 ton per hectare\nakkerbouw: 1 - 2 ton per hectare\ntuinbouw: 2 - 3 ton per hectare\nmest/compost: 30 kg/m3\nstal strooisel: 100 gram per m²','Actimin is een veelzijdige organische mest en bodemverbeteraar die bodemvruchtbaarheid en pH optimaliseert, kationenbalans herstelt, voedingsstoffen opslaat, en diverse andere bodemverbeteringen mogelijk maakt.','',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',0,0,NULL),(5,'ATV poeder','Samenstelling: kruidnagel, lavendel, neem, diatomeeënaarde, zwarte kummel, salie','','','','','Geschikt voor alle dieren.\n\n2 tot 3 keer per week onder de vacht poederen, rug, oksels en buik.\nBehandel ook de omgeving zoals hokken, tapijt, manden en stofzuiger.\nNiet gebruiken op wonden of een beschadigde huid.',30,'','2024-06-01 15:03:59','2024-09-27 11:55:10',0,0,NULL),(6,'Bio Luzerne - Medicago Sativa','','','','','','',0,'','2024-06-01 15:03:59','2025-06-23 11:36:58',1,1,'EU landbouw'),(7,'Bio-Chi voor carnivoren','Samenstelling: hennepschilfers, mariadistel-schilfers, bernagiezaadschilfers, karwijzaad-schilfers, moringa oleifera-gemalen, kurkuma-gemalen, vruchtenpulp-gedroogd, bierbostel, calciumcarbonaat, monocalciumfosfaat, natriumchloride, calciummagnesiumcarbonaat, calciumnatriumfosfaat, magnesiumoxide, kruiden\n','Aanvullende diervoeder voor honden & katten-Analytische bestandsdelen: ruw as 10,4% - ruw vet 7,26% - ruw eiwit 14,78% - ruwe celstof 6,71%','Toevoegingsmiddelen: Nutritionele toevoegingsmiddelen:Vitamine A (3a672a) 10.425 I.E. , Vitamine E(3a700) 122mg/kg ,  Vitamine D3(3a671) 2.063 IE,  koper(II) sulfaat pentahydraat (3b405) koper 15mg/kg, gecoate korrels watervrij calciumjodaat (3b203) jodium 2,4 mg/kg, Mangaan(II) oxide (3b502) mangaan 94 mg/kg,  zinkoxide (3b603) zink 94 mg/kg, gecoate korrels natriumseleniet granulaat (3b802) selenium 0,4 mg','Hond: 2 - 5 gram\nKat: 1 - 2 gram\n\nZorg dat de dieren daarnaast altijd voldoende vers water kunnen drinken.','Mariadistel ondersteunt de lever en helpt bij ontgifting.*\n*Gezondheidsclaims in afwachting van EU-goedkeuring.','3-4 dagen per week geven. Als booster enkele weken achtereen dagelijks geven.',10,'NL223978','2024-06-01 15:03:59','2025-07-02 12:55:10',1,1,NULL),(8,'Bio-Chi Vogels en Knaagdieren','Samenstelling: hennepschilfers, mariadistel-schilfers, bernagiezaadschilfers, karwijzaad-schilfers, vruchtenpulp-gedroogd, bierbostel, calciumcarbonaat, monocalciumfosfaat, natriumchloride, calciummagnesiumcarbonaat, calciumnatriumfosfaat, magnesiumoxide, kruiden\n\n94,44% biologische landbouw, 5,56% niet-agrarische herkomst','Aanvullende diervoeder voor vogels, knaagdieren en konijnen-Analytische bestandsdelen: ruw vet 9,58% - ruw as 8,38% - ruw eiwit 25,47% - ruwe celstof 8,91% - natrium 0,96%- fosfor 0,76%-  magnesium 1,11%- calcium 0,44%','Toevoegingsmiddelen: Nutritionele toevoegingsmiddelen:Vitamine A (3a672a) 10.425 I.E. , Vitamine E(3a700) 122mg/kg ,  Vitamine D3(3a671) 2.063 IE,  koper(II) sulfaat pentahydraat (3b405) koper 15mg/kg, gecoate korrels watervrij calciumjodaat (3b203) jodium 2,4 mg/kg, Mangaan(II) oxide (3b502) mangaan94 mg/kg,  zinkoxide (3b603) zink 94 mg/kg, gecoate korrels natriumseleniet granulaat (3b802) selenium 0,4 mg','2 - 5 gram per dier per dag rekening houdend met gewicht van dier.','De aanwezigheid van mariadistel helpt de levercellen te beschermen en ondersteunt het de lever in zijn ontgiftende functie in het lichaam. *\n* Gezondheidsclaims in afwachting van goedkeuring door de Europese Commissie','Door de aanwezigheid van kruiden in dit product is het aangeraden te starten met een lage dosering nadien geleidelijk opbouwen naar de gewenste dosering\nMeng met enkele druppels goede olie door het voer en meng hierbij vervolgens de Bio-Chi of maak voeding wat vochtig en voeg hierbij de Bio-Chi\nZorg dat de dieren daarnaast altijd voldoende vers water kunnen drinken.\n\n3 tot 4 dagen achter elkaar geven geven\nAls booster enkele weken achtereen dagelijks geven.',10,'DE-NW-006-14765-BE','2024-06-01 15:03:59','2024-09-27 11:55:10',1,1,NULL),(9,'Blote voeten gras','Samenstelling: \nraaigras(gt) 35%, raaigras(gt) 30%, roodzwenk(gt) 25%, roodzwenk 10%','','','Per 100 m²:\nMachinaal inzaai: 1,5 - 2 kg\nHandmatige inzaai: 2 - 3 kg\nDoorzaai: 1 - 2 kg','Biologisch, onbehandeld, robuust gazon- en speelgras mengsel','',0,'','2024-06-01 15:03:59','2025-07-02 11:18:22',1,1,'EU landbouw'),(10,'Biologisch graszaad mengsel 1','Samenstelling: timotee 35%, roodzwenk 25%, beemdlang 25%, kropaar 15%','','','Nieuwe inzaai: 40 tot 60 kg per hectare\nDoorzaaien: 20 tot 30 kg per hectare','4 biologische grassoorten zonder raaigras en klaver.\nGeschikt voor weide of hooiland op alle grondsoorten','',0,'','2024-06-01 15:03:59','2025-04-23 08:23:34',1,1,'EU landbouw'),(11,'Biologisch graszaad mengsel 2','Samenstelling: timotee 20%, festolium 20%, beemdlang 15%, Duits Raai 15%, rode klaver 10%, Alexandrijnse klaver (eenjarig) 7%, rietzwenk 5%, kropaar 5%, witte klaver 3%','','','40 tot 50 kg per hectare','3 klavers en 6 grassoorten.\nBiologisch grasklaver mengsel geschikt voor alle grondtypes','',0,'','2024-06-01 15:03:59','2025-05-01 11:16:32',1,1,'EU landbouw'),(12,'Biologisch graszaad mengsel 3','Samenstelling: timotee 30%, beemdlang 20%, roodzwenk 20%, Duits raai 18%, festolium 10%, rode klaver 1%, witte klaver 1%','','','40 tot 60 kg per hectare','5 grassoorten en 2 klavers.\nBiologisch mengsel voor normale tot vochtige gronden','',0,'','2024-06-01 15:03:59','2025-05-01 11:16:38',1,1,'EU landbouw'),(13,'Biologisch Tubinger bijenmengsel','Samenstelling: inkarnaat klaver 10%, boekweit 10%, koriander 8%, fenegriek 8%, calendula 8%, venkel 7%, komijn 6%, phacelia 5%, serradelle 5%, zonnebloem 5%, Franse kamperfoelie 5%, esparcette 4%, rode klaver 4%, dille 3%, saffloer 3%, bolderik 3%, zwarte kummel 2%, luzerne 2%, witte klaver 1%, bernagie 1%','','','20 tot 25 kg per hectare\nVoor kleinere oppervlakken de zaden wat ruimer doseren: 3 - 4 gram per m²','Meerjarig mengsel van nectarrijke planten voor bijen','',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',1,1,NULL),(14,'Biologische esparcette','','','','','','',0,'','2024-06-01 15:03:59','2025-06-23 11:36:58',1,1,'EU landbouw'),(15,'Biologische phacelia','','','','','','',0,'','2024-06-01 15:03:59','2025-06-23 11:36:58',1,1,'EU landbouw'),(16,'Biologische timotee','','','','20 tot 30 kg per hectare','Geschikt voor hooiwinning met hoge droge stof opbrengst. \nOok geliefd door dieren.','',0,'','2024-06-01 15:03:59','2025-06-23 11:36:26',1,1,'Eu landbouw'),(17,'Biologische zandhaver/Japanse haver','','','','Als groenbemester: 70 tot 80 kg per hectare\nRuwvoer: 60 tot 70 kg per hectare\nOnkruid onderdrukking bij grasinzaai: max. 20 kg per hectare','','Kan ingezet worden als ruwvoer, groenbemesting en als effectieve remedie tegen diverse wortel aaltjes. Het is tevens handig als onkruidbeheersing bij nieuw graszaad. Vooral in droge (zand)gronden is zandhaver aan te bevelen.',0,'','2024-06-01 15:03:59','2025-06-23 11:36:26',1,1,'EU landbouw'),(18,'Biologsich graszaad mengsel 4','Samenstelling: timotee 25%, roodzwenk 19%, beemdlang 15%, kropaar 15%, Duits raai 14%, rietzwenk 10%, rode klaver 1%, witte klaver 1%','','','40 tot 60 kg per hectare','5 grassoorten en 2 klavers.