ux. Le produit n’est pas nocif mais son effet desséchant peut provoquer une irritation des muqueuses.\nMélanger à l\'alimentation de l\'animal.\nPeut être utilisé pour les animaux à sabots, la volaille, les chiens et les chats.',60,'NL223978','2024-06-01 15:03:59','2024-11-14 09:21:22',0,1,NULL),(29,'Echinacea purperea','','','','','','',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',0,1,NULL),(30,'Echte Kamille - Matricaria recutita','','','','','Het toevoegen van kamille bij het zaaien van een weide kan helpen om natuurlijke rustgevende eigenschappen te bevorderen, wat gunstig kan zijn voor zowel grazende dieren als de omgeving.','',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',0,1,NULL),(31,'EM keramiekpoeder Super Cera C','','','','Bodem: 0,3 tot 0,5 kg per 100 m²\nPotaarde: 0,5 % van het volume\nCompost/bokashi : 0,5 tot 1 % van het volume','Keramiekpoeder vitaliseert watermoleculen, bevordert bodemmicro-organismen en fermentatie, verrijkt planten met silicium en micro-elementen, en behoudt zijn effect langdurig, waardoor het een uniek product is. Het verbetert de waterkwaliteit, fermentatie en plantenvoedingseffectiviteit.','',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',0,0,NULL),(32,'EM-Keramiek','','','','','EM keramiek herstelt de natuurlijke balans van watermoleculen, resulterend in perfecte zeshoekige ijskristallen en bevordert zo de gezondheid van organismen.','',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',0,0,NULL),(33,'Biologische esparcettebrok','Voedermiddel: esparcette - gemalen - gepelleteerd\n100% biologisch','Analytische bestandsdelen: ruw eiwit 14,7% - ruwe celstof 29,3% - ruw as 8,3% - suiker 7,7%','','Paard (<500 kg): 100 - 700 gr / dag\nPaard (>500kg): 0,3 - 3,0 kg / dag','','Meng 1 deel esparcette op 2 delen water. \nLaat minstens 15 minuten weken.',14,'NL223978','2024-06-01 15:03:59','2025-05-02 11:02:46',1,1,'EU landbouw'),(34,'Biologische geitenbrok','Samenstelling: gerst*,sojaschilfers*, maïs*, tarwegries*, haver*, luzerne