 g/100g - cystine 0,473 g/100g - threonine 0,93 g/100g - Vitamine B1 16,7 mg/kg - Vitamine B2 1,89 mg/kg - Vitamine B6 8,08 mg/kg \nOmega 3 vetzuren 6,82 g/100g - omega 6 vetzuren 24,15 g/100g - omega 9 vetzuren 4,78 g/100g','','Paard: 6–7 bites (<500 kg) / 9–10 bites (>500 kg) – Kleinvee: 3–5 – Hond: 1–2 per 10 kg – Kat: ½ per kg.\nAls kuur: tot 3× na gewenning.','B2 ondersteunt zenuwen en huid, B6 het immuunsysteem, magnesium spieren en energiestofwisseling.','Hennep Bites zijn de perfecte snack of beloning voor je dieren. Deze bites langdurig en zelfs in hogere doseringen worden gegeven zonder zorgen.',14,'NL223978','2024-06-01 15:03:59','2025-07-02 12:56:15',1,1,'EU landbouw'),(41,'Biologische hennepdoppen','Voedermiddel: hennepzaad\n100% biologisch','Analytische bestandsdelen: ruw eiwit 13% - ruw vet 11% - ruwe celstof 47% - ijzer 171 mg/kg - zink 32 mg/kg - koper 15 mg/kg - magnesium 1,9 g/kg - calcium 2,2 g/kg - suiker 1,3% - histidine 1,78 g/kg - isoleucine 2,89 g/kg - leucine 5,35 g/kg - lysine 3,07 g/kg - phenylalanine 4,31 g/kg - threonine 2,96 g/kg - valine 4,04 g/kg - methionine 1,55 g/kg','','Paard (<500 kg) 50g - 100g per dag\nPaard (>500 kg) 100g - 200g per dag','','Langzaam introduceren in de voeding over een periode van 10 dagen. \nKan worden toegevoegd aan natte of droge hoofdvoeders. \nPas de hoeveelheid aan het lichaamsgewicht van het paard aan. \nVoor de beste resultaten verdeel je de dagelijkse dosis over twee voederbeurten.',12,'NL223978','2024-06-01 15:03:59','2025-04-23 08:23:34',1,1,'EU landbouw'),(42,'Biologisch hennepzaad','Voedermiddel: hennepzaad\n100% biologisch','Analytische bestandsdelen: ruw eiwit 22% - ruw vet 34% - ruw as 39% - ruwe celstof- lysine 9,26 g/kg - methionine 6,3 g/kg -  cystine 4,73 g/kg - threonine 0,93 g/100g - vitamine B1 16,7 mg/kg - vitamine B2 1,89 mg/kg - vitamine B6 8,08 mg/kg - vitamine E 48 mg/kg - omega 3 vetzuren 68,2 g/kg - omega 6 vetzuren 241,5 g/kg - omega 9 vetzuren 47,8 g/kg','','Knaagdieren-vogels: meng 5-10% hennepzaad door het voer.\nKleine dieren (<400 kg): 15-25 gram/dag\nGrote dieren (>400kg): 30-50 gram/dag','Rijk aan zeer hoogwaardige proteïnen, vitaminen, mineralen en omega vetzuren in de ideale verhouding. Bevat essentiële aminozuren','',18,'NL223978','2024-06-01 15:03:59','2025-07-02 12:14:06',1,1,'EU landbouw'),(43,'Kaasjeskruid - Malva Moschata','','','','','Het toevoegen van kaasjeskruid bij het zaaien van een weide kan de biodiversiteit en voedselbronnen voor insecten en vogels vergroten, aangezien kaasjeskruid een aantrekkelijke nectar- en voedselbron is voor verschillende dieren in de natuur.','',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',0,1,NULL),(44,'Keltisch zeezout','Voedermiddel: zeezout','Analytische bestandsdelen: ruw eiwit <0,3%, ruw vet <0,2%, ruwe celstof <0,4%, ruw as 88,3%, natrium 35%, chloride 55%, magnesium 4 g/kg, kalium 1,5 g/1kg, calcium 3,2 g/kg, mangaan 4 mg/kg, zink 2 mg/kg, ijzer 96 mg/kg','','1 tot 5 gram zeezout per liter water.','Zeer rijk aan mineralen en sporen elementen.\nChloride draagt bij tot de normale werking van de spijsvertering in de maag.','Zorg dat de dieren daarnaast altijd voldoende vers water kunnen drinken!',36,'NL223978','2024-06-01 15:03:59','2024-09-27 11:55:13',0,1,NULL),(45,'Kippen tuin zadenmix','Grassen: timotee, beemdlang, festolium, rietzwenk,raaigras, roodzwenk, kropaar.\nMix van minimaal 30 verschillende bloemen en kruiden','','','','Mengsel van grassen, bloemen en kruidenzaden om kippen continu van vers groenvoer te voorzien.','Zaai 5 tot 8 gram per m² op een stukje zaai klaargemaakte grond. Zet dit af met gaas zodat de kippen de zaden niet opeten. Biedt dieren de volgroeide planten aan of/en wat\ndoor het gaas groeit. Eventueel opkweken in aparte potten.\nDieren zullen hier individueel/selectief van eten.',0,'','2024-06-01 15:03:59','2025-02-19 14:52:13',0,1,NULL),(46,'Kippengrit','Samenstelling: koolzure zeeschelpen, lavameel, klei','Aanvullende diervoeder voor kippen-Analytische bestandsdelen: ruw eiwit <0,3% - ruw vet 0,3% - ruwe celstof 0,43% - ruwe as 96,9%  - natrium 430 mg/kg - calcium 4,4 g/kg','','Voer kippengrit naar behoefte naast andere voeding.','Rijk aan calcium wat bijdraagt aan botgroei en zorgt voor stevige eierschalen.','',24,'NL223978','2024-06-01 15:03:59','2024-09-27 11:55:13',0,1,NULL),(47,'Kleimineralen Bentoniet','Montmorilloniet gehalte 65-70%, ionen uitwisseling capaciteit 70-85 mvol/100 , wateropname capaciteit 220-250 %, watergehalte 6-8 %\npH waarde 7,9\nHoofdelementen in %: silicium (SiO2) 56, ijzer (Fe2O3) 0,4, calcium (CaO) 4, magnesium (MgO) 4, natrium (Na2O) 0,4, kalium (K2O) 2, aluminiumoxide (Al2O3)','','Sporenelementen in ppm: mangaan(Mn) 300, zink(Zn) 18, nikkel(Ni) 25, molybdeen( Mo) 20, arseen(As) <6 , lood(Pb) 18, koper(Cu) 22, chroom(Cr) 56','1 kg per 10 m² (jaarlijks)\n1 kg per 50 liter aarde\nCompostverbetering: 10 kg per m3.','Kleimineralen bevorderen bodemvruchtbaarheid dankzij hun fijne deeltjes met hoge opnamecapaciteit. Ze vormen het klei-humuscomplex dat essentiële voedingsstoffen en water opslaat voor planten via micro-organismen.','Kan het gehele jaar opgebracht worden.',0,'','2024-06-01 15:04:00','2025-02-19 14:52:13',0,0,NULL),(48,'Knaagdier tuintje zadenmix','Grassen: timotee, beemdlang, festolium, rietzwenk,raaigras, roodzwenk, kropaar.\nMix van minimaal 30 verschillende bloemen en kruiden','','','','Mengsel van grassen, bloemen en kruidenzaden om knaagdieren en/of konijnen continu van vers groenvoer te voorzien.','',0,'','2024-06-01 15:04:00','2025-02-19 14:52:13',0,1,NULL),(49,'Voor knaagdieren','Samenstelling: spelt, gerst, luzerne, esparcette, grasbrok, groene haver,haver, zwarte haver, boekwijt, tarwe, pompoenpitten, hennepdoppen, hennepzaad, zonnepitten, mais, lijnzaad, linzen, kikkererwten, kalksteen, rijst, sesamzaad, rogge, bonen, lavameel,zeezout','Aanvullende diervoeder voor knaagdieren & konijnen-Analytische bestandsdelen: ruw eiwit 12,47% - ruw vet 8,79% - ruwe celstof 8,37% - ruw as 3,02% - natrium 7 g/kg - calcium 0,17%','Toevoegingsmiddelen: Technologische toevoegingsmiddelen:Bentoniet (1m558i) 1 g/kg','Geef als aanvulling op voeding.\nZorg dat de dieren daarnaast altijd voldoende vers water kunnen drinken.','','',12,'NL223978','2024-06-01 15:04:00','2025-03-25 12:19:47',0,1,NULL),(50,'Korenbloem - Centaurea cyanus','','','','','','',0,'','2024-06-01 15:04:00','2025-02-19 14:52:13',0,1,NULL),(51,'Lava fijn-Farine de lave fine','Hoofdelementen in %: silicium (SiO2) 35-45, ijzer (Fe2O3) 10-12, calcium (CaO) 11-17, magnesium (MgO) 6-16, natrium (Na2O) 4,  kalium (K2O) 4, aluminiumoxide (Al2O3) 11-14\nIngrédients principaux en % : silicium (SiO2) 35-45, fer (Fe2O3) 10-12, calcium (CaO) 11-17, magnésium (MgO) 6-16, sodium (Na2O) 4, potassium (K2O) 4, alumine (Al2O3) 11-14.','','Sporenelementen in mg/kg: zink(Zn) 90, nikkel (Ni) 51, koper(Cu) 65, chroom(Cr) 115, borium(B) 12, kobalt(Ko) 32, selenium(Se) 20\nOligoéléments en mg/kg : zinc(Zn) 90, nickel(Ni) 51, cuivre(Cu) 65, chrome(Cr) 115, bore(B) 12, cobalt(Ko) 32, sélénium(Se) 20','Tuin, gazon en weide/Jardin, pelouse ou prairie: 5 kg per 10 m²\n2 kg per 50 liter aarde/terre\nBoomgaard/verger: 3-30 kg per boom naar grootte/par arbre selon la taille\nWijnbouw/viticulture: 1-2 kg per struik/par buisson\nCompostverbetering/Amélioration du compost: 20 kg per m3\nTurf verbetering/Amélioration de la tourbe: 10 kg op 250 liter','Lavameel uit Eifel oergesteente verbetert bodemstructuur, stabiliseert humus, en bevordert waterbeheer en voedingsstofretentie in verschillende grondsoorten.\nLa farine de lave provenant des roches primitives de l\'Eifel améliore la structure du sol, stabilise l\'humus et favorise la gestion de l\'eau et la rétention des éléments nutritifs dans différents types de sol.','Heel het jaar toepasbaar. Aanbrengen bij lichte neerslag of natmaken. Licht inwerken. \nNiet inademen.\n\nUtilisable toute l’année. Appliquer par temps humide ou arroser. Incorporer légèrement. \nNe pas